import styled from 'styled-components';
import ContainerFluid from '../ContainerFluid';

const Wrapper = styled(ContainerFluid)`
  margin-bottom: 0.3rem;
  padding-top: 2.3rem;

  textarea {
    height: 10.1rem;
  }
`;

export default Wrapper;
